        <hr />
        </div>

      </div>



      <div className="row">
        <hr />  
        <div className="col">
        <SingleDataField name="TxID" value={this.props.data.hash} type="Long" />
        <hr />
        </div>

      </div>

      <hr />
      <div className="row">
        <hr />
        <div className="col">
        <SingleDataField key="001" name="vin" value={this.props.data.vin} type="Variable"/>       
